import React, { useState } from "react";

export const Signup = (props) => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
    }
    return (
        <div className="login-form">
            <form onSubmit={handleSubmit}>
                <label for="email">Enter Your Email: </label>
                <input value={email} type="email" placeholder="example@gmail.com" />
                <label for="password">Choose Your Password: </label>
                <input value={password} type="password" placeholder="**********" />
                <button type = "submit">Log In!</button>
            </form>
            <button onClick={() => props.onFormSwitch('Signin')}>Already have an account? Login here!</button>
        </div>
    )
}
